import React from "react";

function AGEBInfo({ ageb, neighborhood }) {
  if (!ageb || !neighborhood) {
    return <div>No neighborhood or AGEB information available.</div>;
  }

  return (
    <div className="ageb-info">
      <h2>Neighborhood Information</h2>
      <p>Name: {neighborhood.display_name}</p>
      <p>Latitude: {neighborhood.lat}</p>
      <p>Longitude: {neighborhood.lon}</p>
      {/* Display additional AGEB information if needed */}
      <p>AGEB ID: {ageb.id}</p>
      <p>AGEB Properties: {JSON.stringify(ageb.properties)}</p>
    </div>
  );
}

export default AGEBInfo;
